"use strict";
/*
import { ComponentFixture, TestBed } from '@angular/core/testing';

import { AddComponent } from './add.component';

describe('AddComponent', () => {
  let component: AddComponent;
  let fixture: ComponentFixture<AddComponent>;

  beforeEach(async () => {
    await TestBed.configureTestingModule({
      declarations: [ AddComponent ]
    })
    .compileComponents();
  });

  beforeEach(() => {
    fixture = TestBed.createComponent(AddComponent);
    component = fixture.componentInstance;
    fixture.detectChanges();
  });

  it('deberia ser falso', () => {
    (<HTMLInputElement>document.getElementById("firstName")).value = "ww";
    (<HTMLInputElement>document.getElementById("lastName")).value = "ww";
    (<HTMLInputElement>document.getElementById("email")).value = "ppp@gmail.com";
    expect(component.newContact()).toEqual(false);
  });

});
